rent_id, 1);\r\n    exit;\r\n  }\r\n  # otherwise relocate properly\r\n  switch (strtoupper($this->request->GetIndexedParam(0)))\r\n  {\r\n    # the valid \'edit\' opts are\r\n    case \"FOLDER\":\r\n    case \"LINK\":\r\n      if(!$this->suppress_redirect) {\r\n        /*\r\n         * No success notifcation, because the user will see the fucking result by redirecting\r\n         */\r\n        # redirect if any redirection provided\r\n        $this->Redirect();\r\n        # relocate the browser\r\n        header(\"location: /#!/d/{$item_value->parent_id}.{$item}s\");\r\n        exit;\r\n      }\r\n      break;\r\n    case \"NOTE\":\r\n        if(!$this->suppress_redirect) {\r\n          # relocate the browser\r\n          header(\"location: /view/note/{$item_value->note_id}\");\r\n          exit;\r\n        }\r\n        break;\r\n    default:\r\n        # if no ops matched, raise an exception\r\n        throw new \\zinux\\kernel\\exceptions\\invalidOperationException;\r\n  }\r\n  if(!$this->suppress_redirect) {\r\n    # relocate the browser\r\n    header(\"location: /#!/d/{$this->view->pid}.{$item}s\");\r\n    # halt the PHP\r\n    exit;\r\n  }\r\n  if(!$this->ops_index_interface) exit;\r\n}\r\n```\r\nMauris odio nibh, venenatis ac libero at, commodo tempus justo. Mauris sit amet tortor congue, faucibus sem eget, auctor urna. Donec convallis ligula ligula, tempus aliquam nisi varius id. Nunc auctor, dui et facilisis cursus, nisi ligula posuere magna, vitae ultrices sapien erat in purus. Maecenas convallis posuere erat. Nunc vestibulum felis vel sem iaculis, eu pretium dui pellentesque. Etiam ut venenatis augue, ac varius turpis. Quisque sed mauris ac purus congue rhoncus. Donec nec tortor a eros tincidunt mattis. Aenean porttitor, metus id imperdiet mollis, urna nibh egestas enim, consequat sollicitudin metus erat non sapien. Pellentesque semper, sapien at congue egestas, neque lorem pulvinar urna, eu laoreet tellus tortor non leo. Pellentesque elit dui, interdum a